import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Cards from './Cards';
function Grid() {
  return (
    <div className='grid'>
    <Container>
      <Row>
        <Col sm={8}><Cards/></Col>
        <Col sm={4}><Cards/></Col>
      </Row>
      <Row>
        <Col sm><Cards/></Col>
        <Col sm><Cards/></Col>
        <Col sm><Cards/></Col>
        <Col sm><Cards/></Col>
      </Row>
    </Container>
    </div>
  );
}

export default Grid;
